css:
.editor,
.editor .gutter {
  background-color: #2e3239;
  color: #d5d3ed;
}
.editor .gutter {
  color: #6a6f77;
  background: #2e3239;
}
.editor .gutter .cursor-line {
  color: #d5d3ed;
}
.editor .indent-guide {
  color: #343D46;
}
.editor.is-focused .cursor {
  border-color: #fff;
  transition: opacity 0.5s ease-in-out;
}
.editor.is-focused .cursor.blink-off {
  visibility: visible;
  opacity: 0;
}
.vim-mode.command-mode.editor.is-focused .cursor {
  background: #fff;
  opacity: 0.8;
}
.vim-mode.command-mode.editor.is-focused .cursor.blink-off {
  visibility: visible;
  opacity: 0.2;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: #343D46;
}
.variable.parameter.function {
  color: #d5d3ed;
}
.comment,
.punctuation.definition.comment {
  color: #65737e;
}
.invisible-character {
  color: #5b3f84;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.string,
.punctuation.definition.parameters,
.punctuation.definition.string,
.punctuation.definition.array {
  color: #d5d3ed;
}
.punctuation.definition.string {
  background: transparent;
  color: #df0349;
}
.keyword.operator {
  color: #d5d3ed;
}
.keyword {
  color: #c8c7e7;
}
.variable {
  color: #b6a2d3;
}
.entity.name.function,
.meta.require,
.support.function.any-method {
  color: #637b92;
}
.support.class,
.entity.name.class,
.entity.name.type.class {
  color: #ffe43f;
}
.meta.class {
  color: #eff1f5;
}
.keyword.other.special-method {
  color: #637b92;
}
.storage {
  color: #805db2;
}
.support.function {
  color: #637b92;
}
.string,
.constant.other.symbol,
.entity.other.inherited-class {
  background: rgba(223, 3, 73, 0.1);
  color: #df0349;
}
.constant.numeric {
  background: transparent;
  color: #805db2;
}
.constant {
  background: rgba(255, 228, 63, 0.1);
  color: rgba(255, 228, 63, 0.85);
}
.entity.name.tag {
  color: #805db2;
}
.entity.other.attribute-name {
  color: #805db2;
}
.entity.other.attribute-name.id,
.punctuation.definition.entity {
  color: #637b92;
}
.meta.selector {
  color: #805db2;
}
.none {
  color: #805db2;
}
.markup.heading .punctuation.definition.heading,
.entity.name.section {
  color: #637b92;
}
.keyword.other.unit {
  color: #805db2;
}
.markup.bold,
.punctuation.definition.bold {
  font-weight: bold;
  color: #ffe43f;
}
.markup.italic,
.punctuation.definition.italic {
  font-style: italic;
  color: #805db2;
}
.markup.raw.inline {
  color: #9bc753;
}
.string.other.link {
  color: #ffe43f;
}
.meta.link {
  color: #805db2;
}
.markup.list {
  color: #ffe43f;
}
.markup.quote {
  color: #805db2;
}
.meta.separator {
  color: #d5d3ed;
  background-color: #4f5b66;
}
.constant.other.color {
  background: transparent;
  color: rgba(255, 228, 63, 0.85);
}
.string.regexp {
  color: #9bc753;
}
.constant.character.escape {
  background: transparent;
  color: #df0349;
}
.punctuation.section.embedded,
.variable.interpolation {
  color: #d5d3ed;
}
.invalid.illegal {
  background: rgba(255, 228, 63, 0.1);
  color: #df0349;
}
.selection .region {
  background-color: #454b55;
}
.editor .fold-marker:after {
  font-size: 1.6em;
  line-height: 0.8;
  width: 1.2em;
  position: relative;
  top: 2px;
}
.sublimelinter.gutter-mark {
  color: #FFFFFF;
}
.sublimelinter.mark.warning {
  color: #ffe43f;
}
.sublimelinter.mark.error {
  color: #df0349;
}
.editor .gutter .line-number.git-line-added,
.editor.react .gutter .line-number.git-line-added {
  border-left: 2px solid #9bc753;
}
.editor .gutter .line-number.git-line-modified,
.editor.react .gutter .line-number.git-line-modified {
  border-left: 2px solid #ffe43f;
}
.editor .gutter .line-number.git-line-removed,
.editor.react .gutter .line-number.git-line-removed {
  border-left: 2px solid #df0349;
}
.editor .fold-marker:after {
  font-size: 1.6em;
  line-height: 0.8;
  width: 1.2em;
  position: relative;
  top: 2px;
}
.term2 {
  border: 5px solid #2e3239;
}
.terminal {
  background-color: #2e3239 !important;
}
.terminal .cursor {
  background-color: #fff;
}
.terminal .color-0 {
  color: #d5d3ed;
}
.terminal .color-1 {
  color: #F92672;
}
.terminal .color-2 {
  color: #A6E22E;
}
.terminal .color-3 {
  color: #E6DB74;
}
.terminal .color-6 {
  color: #66D9EF;
}
.terminal pre.line span.character {
  font-size: 14px;
}
.cli-status .status-running {
  color: #66D9EF;
}
.cli-status .status-error {
  color: #F92672;
}
.cli-status .status-success {
  color: #A6E22E;
}
.cli-status .terminal {
  background-color: #25282e !important;
  border: 5px solid #25282e;
}
.cli-status .panel-heading .btn {
  font-size: 12px;
}
.cli-status .panel-heading .btn .icon-x {
  position: relative;
  top: 1px;
}
.grunt-runner-results .panel-body li {
  font-size: 13px;
  line-height: 1.4;
  border-bottom: none;
}
.grunt-runner-results .panel-body li.text-success {
  color: #A6E22E !important;
}
.grunt-runner-results .panel-body li.text-warning {
  color: #E6DB74 !important;
}
.grunt-runner-results .panel-body li.text-error {
  color: #F92672 !important;
}
.grunt-runner-results .grunt-panel-heading[data-status=ready]:before {
  color: #A6E22E;
}
.grunt-runner-results .grunt-panel-heading[data-status=warning]:before {
  color: #E6DB74;
}
.grunt-runner-results .grunt-panel-heading[data-status=error]:before {
  color: #F92672;
}
